      "Review after using it for about a month -pros-• battery backup is the most amazing of all.• sound quality is amazing but bass is on the low side.• build quality is well made almost feels premium but could be improved.• very comfy even after a long day use.cons-• There's a noticable delay in touch controls (most irritating one).• There's no such thing as no delay during gaming on wireless earphones. just get wired instead of this if you are planning on using it for gaming.• Noise cancellation calling or enc doesnt work, also while calling 2nd person most of the time says that \"I can't hear you well\" or \"Your voice is so low\" on outdoors.• Sometimes a earphone doesn't turns on, so I have to manually turn it on.• To pickup a call one tap, but here's the catch to disconnect a ongoing call I have to double tap on the touch panel. (boat says single tap tho)Conclusion - If you have a little more budget, don't buy this. else this just works fine.,I recently purchased the boAt Airdopes 181 in-Ear True Wireless Earbuds and have been using them for the past week. Overall, I am satisfied with the product. The earbuds are comfortable to wear and have a good fit, and the sound quality is impressive for the price point.However, I was disappointed to discover that the earbuds do not have noise cancellation as advertised. While they do block out some ambient noise, they are not as effective as other earbuds I've used with noise cancellation technology.The battery life has been satisfactory. The earbuds last for a good amount of time on a single charge, and the case is convenient for charging on the go.Overall, I would recommend the boAt Airdopes 181 earbuds for those looking for a budget-friendly option with good sound quality. Just be aware that they do not have noise cancellation.,I am writing this review after two days of usage.1. Sound Quality: The lows are good and pleasing to the ears. Bass quality is good. I just felt like the treble is a little too high which makes the high frequency music sound a bit unpleasant. Overall the quality is okay but not as good as a wired headset or neckband earphones. (Kaam chal jayga)2. Battery Backup: It's been 2 days and I haven't charged it yet....still showing 70+% of battery remaining. So I don't think battery backup would be a problem. (moderate usage)3. Built: The case is small and handy. It feels sturdy. The buds fit well in the ears. Overall built is good.4. Latency: This one's for gamers. I am actually impressed by the low latency it has. Even without turning on the 'Beast Mode', the feedback is almost instantaneous. And after turning on the Beast mode, it becomes flawless. I played BGMI and COD and didn't feel any lag in the sound.5. Calling: I tried calling in a silent atmosphere and there was no problem faced. Will update you guys if there turns out to be a problem when calling in a crowded area.,In 1399 rupees it is a good earphones. Good battary life, good sound, good connectivityCons- very poor build quality, feel so cheap. If you r a choosy person then you don't like the product.,If you're looking for wireless earphone under 1500 go for it. This product is good the sound leakage is there no doubt but you won't feel any sort of distortion,the airdrops 181 are very handy, compact in size ,long lasting battery for its size and the connectivity is is pretty good along with the sound quality , though it has a room for improvement in noise cancellation but still performs very well for this price point.,Its a good product sound quality is also agood but noise cancellation is average,It is good product but only for 4-5 months.",
