    review_title:
      "Really good for the price [6/8 months update], but with a late appearing issue,After 2 months,Right bud is not performing well,Good value for money!,Working as expected,Best at price,Good built quality, functions need improvement,Product is good but battery not as expected",
    review_content:
      "--------------Update after 8 months--------------Update 1: The problem mentioned in the earliest review is becoming more and more dire with time. Now right earbud gets discharged in hour and a half, whereas left one keeps going, so reducing one star. Will contact them for replacement and update here.Update 2: Called service center, they asked to bring it, but am lazy. I expected they'd replace at home. Paid more attention towards the issue above. The stable situation is that just after full charge, right bud can go upto 4 hrs, but left one always goes for 30-60mins more, and the difference is more if there is a standby of a day or two (when the left one loses juice rapidly it seems), so I guess I can still use the buds but with certain restrictions :) Will happily restore 5 stars if the issue stays stable for next 3 months.--------------Update after 6 months--------------No change in quality, still the pack charges the buds like a boss. During this period, they were once kept in mouth by my infant nephew for over half an hour (very dangerous, thankfully he couldn't swallow them!), full of saliva and whatnot, and on another occasion I threw one of my earbuds on the floor with full force (undisclosed depressing reason) due to which the touch panel with the logo got detached, which I then re-attached. After all this, buds are still rocking with same sound quality as on day 1. I think these are pretty darn sweet deals! Lack of volume control, etc. etc. is all forgiven. Happy customer. Although the issue of left earbud discharging earlier than right persists.-------------------Original review-------------------Using for last 2 months.I am an audiophile and also an instrumentalist. But I hadn't used any tws yet, so wanted to dip my toes and didn't want to invest much, but also not something throwaway. So settled for boult (no boat etc. due to their highly adultered sound signature), since I have previous experience with it. I like my music flat at studio quality. More recently, I've been using a low cost headphones with mindblowing performance: oneodio pro50. Go ahead and search it. It is really one of a gem for all those purist sound fans.Coming to this tws.Connectivity. Right out of the box, only left one was working after connecting to my iphone. Maybe right one didn't pair correctly to left. Did that reset thing as suggested (which also took some effort), but after that, both started working and since then, no issues. I am using both my phone and laptop (linux). Ofcourse you need to disconnect one to use another. But perfect connectivity now. I can move around in my 1300 sqft apt and no connection loss, which is great.Call quality is decent, faced no disconnects yet, and the other party is also ok with my voice, but you cannot talk in a hushed voice, you always need to speak up in a medium volume to let the other party understand you.Features. Tapping is oddly sensitive, I mean it responds even if I am adjusting the bud, and not touching the central area, but surprisingly takes a decent tap punch to play/pause. I can get used to that though. One thing, track aage peeche is ok. But these don't have anything which can control the volume. Bummed on that.Battery. Decent backup. It's been nearly 2 months. I use buds on an average of 2-3 hours daily, and I just had to charge the main case just 3-4 times. In an emergency I also used it to charge my iphone which it did really quickly. I was happy to see that. One weird thing to notice is that the right earbud always discharges more quickly than the left, infact I can use the left one 20-30 mins more that the right. But anyways, I put them both in the case once any one of them starts to complain of low battery.Sound quality.Bass frequencies: Very decent bass. Surprisingly great low bass (songs like 'the humma song', 'i wanna love you' sound pretty good), but a bit lacking in other frequencies of bass ('lut gaye' by Jubin doesn't sound that punchy as it should for a flat signature). Overall for the most part, you should be fine.Other frequencies: I'll review this from vantage point of studio quality signature. For mids, the spectrum is tilted towards bit of high bass (but surprising absence of very specific high bass frequencies as mentioned above), but its bearable. For highs, initially I felt the presence [a bit] lacking, which takes away that warmth and fidelity from a few tracks, but after using it for a few days, I started feeling alright in that aspect, maybe some burn in? God knows. Also remembering that I paid just 1800 bucks for these! I mostly will be using these while my walking and workout sessions, so I think my mind won't be nitpicking then. I'll soon be upgrading though.Overall, really a very decent purchase with good sound quality provided you can get these for under 2k. Cheers!,Hey.  .This one item has a built quality is like a stone..and also the working condition and sound quality it is marvelous, but only one problem is the noise cancellation that not working properly which means when we are in a crowded area while recording something or a call to another person the unwanted noises are coming they cannot hear properly our voice that's the only disadvantage on this one..,Right buds not performs well, I am trying to change music to next but it still plays the same which should not happen according to manual,Been using these for a month now. Can't massively complain, the sound quality is decent enough (may not be good enough for big music heads, not enough bass) and provides good noise isolation. Very impressed by the battery life with the charging case, and I use it every day. If you can snag it on a deal for ~1500 bucks it's a fantastic deal.,My only issue is,  we can't change the connection to 2 devices by 1 click.  Every thing else is fine.,Best at price. and require some button for operation.,call pick up /rejection function, next song play function not working on single touch,Product is good but battery not as expected",
