    user_name: "Jaydeep,Jayakrishnan R",
    review_id: "R1BD0HURZRIGKV,RKQY8Y6U3Y4BT",
    review_title:
      "A perfect balance of price and performance,Great Suction and above average mopping | Good Buy",
    review_content:
      "Very happy with the product performance.Installation: Very easy to start using. Had to wait for 2 days for the technician but with the instructions from box, you can start yourself without waiting.In the box: 10 disposable mops, 1 washable mops, 2 side brushes, 1 main brush, Mopping plate, Deebot, Dust chamber with HEPA filter, Charging Dock, Cable, User Manual, Cleaning BrushCleaning performance: Superb cleaning with 4 power options - Quiet, Normal, Max and Max+. Lower suction means lower battery consumption. With higher suction power even the minutest dust particles will be cleaned up (Good if you have children in the house). Higher suction also means you need to clean the dust chamber more frequently. In all the 4 power options, the house will look clean and will collect most visible dust. The higher options are for deep cleaning. Also if you have groves or areas that accumulate dust over time in the flooring, the higher power will pull out dust from these tiny places.Cleaning Pattern: 1st edges of the room are cleaned and then it will run a north-south or east-west cleaning pattern inside the edges. No specific patterns like Y or Spiral)Mopping Performance: The mopping also has electronically controlled water usage - Low, Medium, High, Ultra High. The app shows warnings when using High and Ultra High (The robot may slip due to water on the floor) but I have been using High water flow on ceramic tiles and have not faced such a problem. The wheels of the robot have good grip which help with the higher water settings. The mopping will become more and more effective over time with usage of the reusable mopping pad (As it gets older, more area will touch the floor than a new mopping pad. For the 1st week, the mopping is not as good as the mopping pad does not entirely touch the floor but with usage the shape of pad will adapt and you will get better results.)Corner Cleaning: 1-2 cms of wall corners may not be cleaned, esp. if you don't have straight walls (E.g. if you have a bathroom door, which has a 1 cm cutout in the wall, then the corner area around the door might not be cleaned). 90 degree wall corners may have a 1-2 cm area which is not cleaned, however the side brushes are large enough for most of these corners. All other areas with obstacles, such as chair or table legs will be properly cleaned (Deebot may run around them 2 or 3 times).Corner Mopping: As the Deebot's mop is round, it will not reach the corners, expect a 5-6 cm area in the 90 degree wall corners not being mopped. However on straight walls, the cleaning is very effective as it may only miss 1-2 cms, which however will be cleaned by side brushes.IMPORTANT: If you have black furniture, Black stone / wall tiles, mirrors or any reflective furniture at the height where Deebot's Top mounted laser is located, the corner area near that black furniture will not be cleaned by Deebot. The laser is not able to properly recognize that it is a wall and will run a few centimeters away from that wall. This is important to consider if you have substantial amount of blacks in your house as the cleaning will be less effective.Mapping: The 1st run will map the entire house and you need to follow Deebot as it maps so that no areas are obstructed. Subsequent runs will update the map with any obstacles e.g chairs and tables if they were not initially mapped. The N8 version does not have additional sensors as the pro version. So it may crash into smaller items that the top mounted laser cannot directly see. Also, you can save at maximum of 2 maps at a time (2 floors). The 1st run will be a very random cleaning pattern. After the 1st run, you can edit the rooms (Divide or merge areas) and rename the rooms based on some preset options like Living room, bed room, kitchen, etc.). Once the rooms are mapped, Deebot will clean each room in the subsequent run and then you will be able to see proper cleaning pattern)The created maps are not editable (you cannot move or adjust boundaries). You have option to add virtual boundaries (as a line or as a rectangle box) where the robot should not go. This is extremely useful if you have mirrors or reflecting furniture at the height of Deebot. Deebot's laser reflects off the mirrors and assumes there is area of the house where it may be able to go (behind the mirror). So you need to manually block this mapped area behind the mirror with a virtual boundary or box. Deebot will automatically detect carpets and not mop over them (if you have installed mopping plate, then Deebot will ignore carpet area). Also there is an option to mark areas as no mop areas (Similar to Virtual boundary).Application Use: I used the android application for setup and regular cleaning functions. The app has an advanced mode, which works as per the stored map. If you turn it off, Deebot will start cleaning wherever you place it. E.g. I have a balcony which can't be accessed by the Deebot directly. I can pickup and place it in the balcony, turn advanced mode off and start cleaning. Once it is done, it will return to the place where you put it and notify that docking station is not accessible.The app also has 3 cleaning modes with advanced mode turned on. Area cleaning (Select a room or multiple rooms to clean), Auto clean (Clean the entire house), Custom Cleaning (Select an area on the map to clean).You can preset the sequence in which you want to clean the rooms. You can also set different vacuum and water levels for each room (or can use a common setting for the entire house). You can also preset how many times (Options are once or twice) you want to clean a specific room. You can also set multiple cleaning schedules based on which room you want to clean at what time of the day. Deebot will start working automatically. However, this is not advisable if you are mopping. As per the technician you must remove mopping plate after use. If any water leaks onto the parts, it may void warranty.There is an option to auto boost suction on carpets (to Max+). You can set the option for continuous cleaning, i.e. whether you want Deebot to auto restart cleaning if it runs out of charge midway. (Deebot will only recharge partially based on the remaining cleaning area, resume the cleaning, and then return to recharge - this saves time)The app also shows usage period of accessories in hours and the total expected usage time. It is an Ecovacs recommendation to replace the accessories - Side Brush, Main Brush, HEPA Filter. This area of the app also shows how to clean or maintain with images, which is really helpful.The app shows a history of cleaning cycles with maps. This helps to check if any areas were not cleaned.Cleaning and Maintenance: Expect that instead of cleaning the house daily, you will be washing the mopping pad every day and Cleaning Deebot once every week (depending on the size of your house). Cleaning will take around 30 to 40 minutes - remove all hairs from side brush, main brush and wheels, remove the dust chamber, remove the HEPA filter and wash the dust chamber, Wash the main and side brushes (if needed), Clean all the sensors of Deebot with a dry cloth, Let the washed accessories dry and then reinstall them. Also, remember that the investment in a robot is not a onetime cost. You will need to replace the accessories every 6-12 months based on the usage and maintenance. Consider the replacement cost also while evaluating a price point for investment in a robot vacuum.Overall Rating: 9/10 The cleaning and mopping performance is very good, and better than a house maid in most circumstances. (E.g. Deebot goes under the sofas). Expect manual work such as clearing the rooms before running the cleaning cycle, and cleaning areas out of reach of Deebot. In this price range, I am very satisfied with the performance.,",
