    review_id:
      "R2FNV0NZDLWHE,R2M99BK02MCDNV,R2P5UQ0XEPCTOW,R1J2HEVC2FWFAN,R2RIUPW9S9ZHGN,R2LV0EOIWD1E49,R1D75XFJREJIF7,R2K5FL56JA45QK",
    review_title:
      "Sufficient for a Family,Makes superior coffee,almost par with those brewed in CCD,value for money,Nice,Doesn’t justify the Description,Good for the price,Unnecessary Buy,Delivery without Warranty Card",
    review_content:
      "This machine can easily brew coffee for a family of 4-6 members at a time. Some people asked whether this can be used in a cafe. The answer is simple 'NO'. Reason is that this isn't a sophisticated machine like a professional commercial grade coffee brewer.Now my experience with this machine was good. And a bad thing was that I did not get the steam pipe sleeve. Except that, everything was well packed. When you buy this machine, make sure to rinse the internal passage. throw the first water from the machine. thoroughly wash the caraffe, puck, filter and measurement spoon. Remember to NEVER USE dishwash gel or soaps to wash carafe, puck or anything such. It may ruin the coffee aroma.Method (efficient as per my opinion):1. Fill the water in tank. No need to measure it as it can be controlled with the selector. Don't run it dry. It may damage the heating element or pump.2. Switch ON the machine. After that, pour the ground coffee powder inside the filter, level it and press it to compress. I use 1:2 ratio. 1 spoon of coffee powder to 2 spoon of water at output.3. Before changing over to drip mode, open the steam valve and check if sufficient pressure is built. Placing carafe under the puck, slowly move the selector till Europa, and quickly back it to steam icon. This will let the coffee bloom inside. After 5-7 seconds, slowly move the selector upto Espresso. The decoction should be not too slow or not too runny.4. Wait till your desired quantity is reached and quickly change the selector to steam mode.5.  Take milk in a tumbler which is slightly larger than the level of milk. Place the tumbler under the steam pipe such a way that the tip should immerse just slight under milk meniscus. Slowly open the steam valve located at the side. Steam it as per your need.6. Mix the milk and decoction. That's itRemember to not uncap the top lid after usage as there may still be pressure inside. Open the steam valve and let all the pressure get released.Coffee used: Bombay Island Espresso grind Medium Roast. Use only espresso grind or maybe south indian filter grind. Don't use Aeropress, V60 or any other grind as it may not produce desired taste.I personally like this machine. For the price it's good and build quality is Moderate. Please watch some YouTube videos if you are new to coffee machines. It's very very easy to ruin coffee without proper knowledge. You may also watch James Hoffmann. He is World Barista Champion and shares tips about coffee.,I'm a fan of espresso. Every time I go to a coffee joint, I tend to order a doppio( A double shot espresso). But, those prices are way too high if I wished to drink a cup of espresso twice everyday. So, I've decided to buy this machine. One thing to say, the quality and durability depends on the user. If you take care, the machine would take care of your cup of joe.So, how do you properly clean this thing is the question raised by many guests after seeing.1. Always rinse the drip tray2. Use 10% dish washing liquid with 90% water to clean the carafe3. Do not hit the filter basket to drop the used grounds. Run water over it forcefully to loosen the grounds. This is crucial because dents can affect quality4. Before and after your brewing activities, make sure that you clean the internals. To do this, fill the carafe till the 4 mark with bottled water.  Assemble an empty perma-filter.  Switch on and set the strength to max. In about a minute, you can see steaming hot water flow into the carafe. Check its color. If it's yellow, then rinse and repeat. If it is white, dry everything and switch it off. Then, either do your coffee brewing or assemble it back and call it a day.5. Always let the steam out. When you froth milk, immediately wipe off the residual milk with a lint free clothWARNING: NEVER EVER USE HARD/TAP WATER. IT CAUSES SERIOUS LIME-SCALING ISSUES WHICH CAN GREATLY AFFECT THE TASTE, QUALITY OF YOUR COFFEE. IT MAY ALSO CAUSE DIGESTIVE ISSUES. ALWAYS USE SOFT-CAN WATER(THE WATER MUST NOT TASTE SALTY OR SWEET).  TAKE THIS SERIOUSLY. PLEASE DO NOT POST MISLEADING REVIEWS STATING THAT MY MACHINE BROKE.THE STEAM KNOB IS THE WORST PART OF THIS MACHINE. THE MACHINE WAS USED JUST FOR 14 DAYS. THEN, THE STEAM KNOB DECIDED TO LOOSEN UP AND FALL OFF. I CALLED THE SERVICE CENTER. THEY TOLD ME TO BRING IT THERE. THE PROBLEM IS I'M JUST 17, AND I CANT DRIVE. AND THE SERVICE CENTER IS FAR AWAY. SO, I REMOVED THE RUBBER CASKET AND FIXED THE KNOB DIRECTLY. IT COMES OFF, BUT I THINK I'LL USE IT ONLY TO EASE THE PRESSURE, BECAUSE I ALWAYS DRINK IT BLACK. BUT THIS ISSUE MAKES ME REDUCE A STARTips for using the machine.1. Use fine grounded coffee. I use Narasu's PB or Royal Elite Bold. Currently,  I'm using Phalada Pure & Sure Organic Coffee Powder. For the best results, you must grind the coffee on your own. If you can't make sure the coffee is fresh. Mind that using instant coffee powder or using coffee mixed with chicory can lead to disaster, both for the machine and your stomach respectively. You can also go for Lavazza. But, it makes a hole in your wallet deeper than the Mariana Trench.2. Only use good quality bottled/can water.3. Maintain a good cleaning discipline4. In case you've used hard/tap water, immediately do a descaling. Refer your instruction manual.5. Always tamp your ground in the filter. You must apply about 30 pounds of force. This is about 13 kg of force. Hold the force for about 6 seconds and slowly rotate the tamper before removing it. Make sure the filter lock is up when doing thisAs you can see, this is a real espresso maker. It produces crema provided that you use fresh and the correct coffee. For me, it produced about 4 mm crema for a double shot. This is good for a steam driven machine. Note that this is a steam driven machine. You can never get the finish of coffee joints, because they use dual boilers powered by thermoblock pumps. Although the tastes would be similar, provided you use the correct beans.Please look at the pics  to see the finish. The cirrus clouds like crema was from coffee powder a week old. The brown and rich crema is from that organic coffee powder I've just bought. Can you notice the finish being directly proportional to the freshness? This applies even to taste. The white crema cup tasted a bit bitter and left a bittery taste in my mouth. The brown crema cup tasted like coffee at its best, leaving a crisp and nutty taste. Also, after I did some research, I came to know that an espresso must have three layers. A bitter crema, a sweet middle and a nutty acidic bottom. You must mix these before drinking to have the best shot. If you see the glass picture I've attached , you can clearly see those layers.OVERALL, THIS IS A GREAT ESPRESSO MACHINE FOR A BEGINNER. IT MAKES GREAT ESPRESSO AND IT IS ECONOMICAL TOO. AS I SAID, IF YOU TREAT THE MACHINE WELL, THE MACHINE WOULD TREAT YOUR CUP OF JOE WELL.,Being a coffee enthusiast, the product fits in my requirement.Easy to use. Time taken is reasonable. Adjustment of intensity works well.Frothing tool is very good... though i prefer black coffee, frothing helps getting a perfect creamy coffee for my guests.,Nice product,The coffee strength nob is a mythBut itne paise me itna is good,Very happy with the machine, works fine and easy to operate, unfortunately it wasn't packed very well buy the seller so the plastic spoon that came with the machine was broken , everything was packed in the original box with only one tape to secure the box.,It makes the whole process of making coffee more difficult. Also was shocked to know this is not covered under Amazon's return policy. My bad I didn't check and now I am stuck with this. Life is no better after you buy this.,Coffee maker delivered without Warranty Card & Instruction manual",
